import React, { useState } from 'react';
import Formulario from '../components/Formulario'



function App() {
// try with rendering ul and tables from a STATE
//here its a ARRAY of objects, while in FORMULARIO is a single object that will be inserted in the array.
let [names, setNames] = useState([{
  Model: '',
  Licenseplate: '',
}])

  return (

    <div className="App">
      <Formulario setNames={setNames}/>
      <div className="ListWrapper">
        <ul>
         {names.map((item, index) => 
           <li key={index}>
              {item.Model} <br></br>
              {item.Licenseplate}
         </li>
         )}
        </ul>

      <div className="TableWrapper">
        <table>
          <thead>
            <td>Model</td>
            <td><LicensePlate></LicensePlate></td>
          </thead>
        </table>
      </div>
      </div>

    </div>
  )};
export default App;
